import ExpenseItem from "./ExpenseItem";


// When passing any prop other than a string (IN THIS CASE AN ARRAY) to a React component, we have to wrap the value in curly braces.

function Expenses({props}){

    return(
    // <ExpenseItem title={props[0].title} amount={props[0].amount} date={props[0].date}/>

    props.map(expense => (
        <ExpenseItem title={expense[0].title} amount={expense[0].amount} date={expense[0].date}/>
    ))
    );

}

export default Expenses;
